        "content": "3\t终端管理\n3.1\t终端\n>>查看、管理已纳管的终端及对终端或终端组下发任务。\n3.1.1\t终端纳管\n>>将终端纳入该服务器管理，可对纳管终端进行任务下发及策略下发。\n3.1.1.1\t手动纳管\n执行以下操作进行手动搜索终端：\n1、导航区域，单击“终端管理”，点击“管理终端”，单击“手动纳管”按钮\n2、搜索界面输入IP范围（如果不输入则搜索服务器所在的C类网段），单击“开始搜索”。\n此步骤可以参考如下链接http://mspad.com/picture_3-1\n3、选择要加入管理的客户机，单击“加入管理”。\n4、若弹出以下提示框，点击确认输入密码（密码一般是Admin123!@#或Centerm123!@#）。\n此步骤可以参考如下链接http://mspad.com/picture_3-2\n此步骤可以参考如下链接http://mspad.com/picture_3-3\n5、选择组窗口，选择一个组，点击“确定”。此步骤可以参考如下链接http://mspad.com/picture_3-4\n6、成功添加终端，关闭搜索界面。 \n3.1.1.2\t自动搜索\n>>参照3.2.2",
