        "content": "3.1.6\t终端操作\n>>使用终端迁移功能，管理员对已管理的终端修改服务器地址和端口。\n导航区域，终端管理 > 管理终端 > 勾选所要下发任务的终端 > 操作->操作类型选择迁移终端->创建任务名称->设置任务时间->设置新服务器地址和端口->单击提交生成任务\n3.1.6.1\t操作步骤\n1、操作类型选择\n此步骤可以参考如下链接http://mspad.com/picture_3-17\n2、创建任务名称\n此步骤可以参考如下链接http://mspad.com/picture_3-18\n3、设置任务时间\n此步骤可以参考如下链接http://mspad.com/picture_3-19\n4、 设置参数，点击提交即可下发任务。\nA.\t发送通知\n>>标题和内容必填         此步骤可以参考如下链接http://mspad.com/picture_3-20\nB.\t时间设置\n>>自动调整时间，需填写自动获取时间的IP地址           此步骤可以参考如下链接http://mspad.com/picture_3-21\nC.\t网络设置\n>>配置DHCP及DNS地址，DNS地址自动设置则不需要填写首选DNS服务器\n此步骤可以参考如下链接http://mspad.com/picture_3-22\nD.\t电源管理\n>>启用电源管理；选择参数。\n此步骤可以参考如下链接http://mspad.com/picture_3-23\nE.\t外设管理\n>>选择外设启用与否，提交后终端需重启才会生效。\n此步骤可以参考如下链接http://mspad.com/picture_3-24\nF.\t安全设置\n此步骤可以参考如下链接http://mspad.com/picture_3-25\nG.\t进程黑名单\n>>启用进程黑名单，可选择黑名单分组，点击编辑可调至《高级管理-黑名单管理》中编辑黑名单进程及分组\n此步骤可以参考如下链接http://mspad.com/picture_3-26\nH.\tWEB安全\n>>启用WEB监控，可自行添加黑名单域名。\n此步骤可以参考如下链接http://mspad.com/picture_3-27\nI.\t电源控制\n>>操作可选择重启、关机、远程唤醒；进而配置参数。\n此步骤可以参考如下链接http://mspad.com/picture_3-28\nJ.\tAgent密码\n此步骤可以参考如下链接http://mspad.com/picture_3-29\nK.\t日志收集\n>>直接点击提交即可收集日志。\n此步骤可以参考如下链接http://mspad.com/picture_3-30\nL.\t终端升级\n>>选择升级类型后选择升级文件及对应参数。\n此步骤可以参考如下链接http://mspad.com/picture_3-31\nM.\t性能告警\n此步骤可以参考如下链接http://mspad.com/picture_3-32\nN.\t提取镜像\n>>设置提取的镜像名称及描述。\n此步骤可以参考如下链接http://mspad.com/picture_3-33",
