        "content": "3.5\t资产管理\n>>管理用户下的资产，修改资产的状态。\n3.5.1\t添加\n>>点击添加按钮，输入MAC地址，即可添加资产。\n此步骤可以参考如下链接http://mspad.com/picture_3-51\n3.5.2\t修改\n>>点击列表操作列编辑按钮，即可编辑资产的MAC地址\n3.5.3\t删除\n>>勾选需要删除的资产，点击删除按钮。\n3.5.4\t修改状态\n1、点击列表状态列的编辑图标\n2、在弹窗中选择要修改的状态，点击确定按钮。\n此步骤可以参考如下链接http://mspad.com/picture_3-52\n说明：\n1、总共有：闲置，在用，维修，报废，4个状态\n2、新增的记录初始状态为闲置\n3、终端上线后，会从闲置、维修、报废状态变更为在用状态\n4、添加维修记录后，会从闲置、报废状态变更为维修状态\n5、支持闲置状态的终端变更为报废状态\n6、支持离线状态的在用终端变更为闲置状态\n7、报废状态的终端不允许手动变更状态（允许系统变更为在用或维修）\n3.5.5\t导入数据\n>>点击导入数据按钮，选择对应文件即可导入数据。\n3.5.6\t下载模板\n>>鼠标移至导入数据按钮，下方会出现悬浮窗口，内有下载模板按钮，点击即可下载。",
