        "content": "5\t策略与任务\n5.1\t策略管理\n>>查看策略生效情况及管理策略启用、禁用及导出。\n>>创建电源策略，策略需要绑定到终端分组，策略创建成功后，会自动生成策略中心任务并自动执行，实现终端的电源策略自动下发。\n此步骤可以参考如下链接http://mspad.com/picture_5-1\n5.1.1\t搜索\n>>在表格左上方输入框输入策略名称进行搜索\n>>点击高级搜索，在下方选择策略类型、选择创建时间范围进行搜索。\n5.1.2\t添加\n>>导航栏->选择策略和任务->单击策略管理->点击添加->选择策略类型->设置策略名称->绑定终端组->设置策略参数->生成策略   \n1、选择策略类型。 \n>>配置策略需选择具体配置。\n此步骤可以参考如下链接http://mspad.com/picture_5-2\n2、设置策略名称\n此步骤可以参考如下链接http://mspad.com/picture_5-3\n3、选择终端分组。\n此步骤可以参考如下链接http://mspad.com/picture_5-4\n4.、设置参数，并单击“提交”，生成策略任务。\n>>参考 3.1.6 终端操作\n此步骤可以参考如下链接http://mspad.com/picture_5-5\n5.1.3\t策略启用禁用\n1、导航栏单击“策略和任务->策略管理”进入策略中心管理界面。\n此步骤可以参考如下链接http://mspad.com/picture_5-6\n2、设置策略启用禁用（需先勾线策略）。\n5.1.4\t查看详情\n>>点击策略列表右侧的查看按钮，即可查看策略的生效详情。\n>>生效详情可查看详细执行过程，点击详情列表右侧查看按钮即可查看。\n此步骤可以参考如下链接http://mspad.com/picture_5-7",
