        "content": "5.2\t任务\n系统对云终端的管理操作，绝大多数通过任务的形式完成。任务模块提供以下功能：\n1.查看创建任务的执行结果；\n2.管理创建任务，如搜索、删除、导出和查看等\n           任务中心功能的入口：导航栏菜单点击”策略和任务->任务管理”。\n5.2.1\t任务属性\n任务具备以下几个属性\n5.2.1.1\t任务名称\n任务名称是用于标识任务的关键词，当管理员创建一个任务时，需手动创建任务名称。\n5.2.1.2\t任务目标\n任务目标是当前任务所针对的目标终端，至少需要一台终端才可生成任务。\n5.2.1.3\t任务开始时间\n任务开始时间是任务开始被调度的时间，当任务未到开始时间时，将处于等待调度的状态。\n>>立即开始：立即开始调度当前任务。\n>>指定任务开始时间：指定任务开始调度的时间，指定的时间必须比服务器当前时间晚。\n5.2.1.4\t任务结束时间\n任务结束的时间点。\n5.2.1.5\t任务类型\n由任务自身决定，与管理操作类型相关。\n5.2.2\t删除任务\n说明：\n当管理员删除任务时，会先取消等待调度和正在调度的任务，然后进行删除。\n>>任务导航面板> 策略和任务>任务管理>选中一条记录>点击“删除”\n1、导航栏菜单点击“策略和任务>任务管理>选中一条记录”：\n2、中间面板选择一条记录，点击”删除“按钮",
