        "content": "6\t审计管理\n>>审计管理提供任务审计、策略审计、资产审计等日志审计，管理员可以根据需要对这些信息进行查询和管理操作。\n6.1\t任务审计\n任务审计包括管理员任务、任务执行详情和终端任务。\n6.1.1\t管理员任务\n>>导航栏菜单点击“审计管理->任务审计->管理员任务”\n6.1.1.1\t任务列表\n1、导航栏菜单点击“审计管理->任务审计”\n2、中间面板展示管理员任务日志\n此步骤可以参考如下链接http://mspad.com/picture_6-1\n3、点击高级搜索，可依据任务类型和操作时间搜索管理员任务\n此步骤可以参考如下链接http://mspad.com/picture_6-2\n4、点击“>”，可查看设置的任务参数\n此步骤可以参考如下链接http://mspad.com/picture_6-3\n说明：\n面板头部提供日志的查询和导出功能，管理员输入条件可查询和导出对应的记录\n6.1.1.2\t执行详情\n>>查看任务执行详情、重试、删除任务或取消任务执行。\n1、导航栏菜单点击“审计管理->任务审计”\n2、点击“查看”\n3、中间面板展示任务执行详情\n此步骤可以参考如下链接http://mspad.com/picture_6-4\n说明：\n面板头部提供根据终端名称、分组以及IP等条件来查询任务执行详情。",
