        "content": "9.2\t账号信息\n9.2.1\t添加账号\n需要添加账号，请执行以下操作：\n1、在导航栏单击“账号管理 > 账号信息”，进入账号信息界面。\n2、在账号信息界面单击“添加”。\n此步骤可以参考如下链接http://mspad.com/picture_9-4\n3、输入账户信息，单击“确定”。\n此步骤可以参考如下链接http://mspad.com/picture_9-5\n4、点击下图所圈图标可选择账户角色。\n           此步骤可以参考如下链接http://mspad.com/picture_9-6\n5、点击账号状态，启用账号。 即可完成添加可使用的账号。\n9.2.2\t修改账户\n9.2.2.1\t修改基本信息\n需要修改账户基本信息，请执行以下操作：\n1、在导航栏单击“ 系统设置 > 账号管理”，进入账号信息界面。\n2、点击该图标可对账户信息进行修改。\n此步骤可以参考如下链接http://mspad.com/picture_9-7\n3、编辑账户信息，单击“确定”。此步骤可以参考如下链接http://mspad.com/picture_9-8\n9.2.2.2\t修改权限\n>>点击终端权限后图标，即可选择拥有的终端权限\n此步骤可以参考如下链接http://mspad.com/picture_9-9\n9.2.2.3\t修改角色\n>>点击下图所圈图标可选择账户角色。\n此步骤可以参考如下链接http://mspad.com/picture_9-10\n9.2.3\t删除用户组\n需要删除账户，请执行以下操作：\n1、在导航栏单击“系统设置 > 账号管理”，进入账号信息界面。\n2、点击该图标可删除账户。\n此步骤可以参考如下链接http://mspad.com/picture_9-11\n3、在确认对话框单击“确定”。                \n此步骤可以参考如下链接http://mspad.com/picture_9-12\n9.2.4\t搜索账户\n需要搜索用户，请执行以下操作：\n1、在导航栏单击“系统设置 > 账号管理”，进入账号信息界面。\n2、搜索框可输入姓名进行搜索。\n此步骤可以参考如下链接http://mspad.com/picture_9-13\n9.2.5\t重置密码\n>>系统内置系统管理员，可重置其他账号密码。\n>>点击账号卡片的密码后的重置密码按钮，即可给该账号重置密码。\n此步骤可以参考如下链接http://mspad.com/picture_9-14",
